@Component({
  selector: 'app-player-hand',
  templateUrl: './player-hand.component.html',
  styleUrls: ['./player-hand.component.css']
})
export class PlayerHandComponent {
  card: Card = {value: "0", suit: "diamonds", selected: false};
}
